<textarea id=check1textarea>
model TestStiffness
  Modelica.Electrical.Analog.Basic.Ground G annotation(extent = [46, -60; 66, -40]);
  Modelica.Electrical.Analog.Basic.Inductor I(i(start = 0.15)) annotation(extent = [-20, 20; 0, 40]);
  Modelica.Electrical.Analog.Ideal.IdealOpeningSwitch S annotation(extent = [20, 20; 40, 40]);
  Modelica.Electrical.Analog.Sources.SineVoltage V annotation(extent = [-48, -20; -28, 0], rotation = 90);

equation

  connect(S.n, G.p) annotation(points = [40, 30; 56, 30; 56, -40], style(color = 3, rgbcolor = {0, 0, 255}));
  connect(V.n, I.p) annotation(points = [-38, 0; -38, 30; -20, 30], style(color = 3, rgbcolor = {0, 0, 255}));
  connect(V.p, G.p) annotation(points = [-38, -20; -38, -40; 56, -40], style(color = 3, rgbcolor = {0, 0, 255}));
  connect(booleanStep.y, S.control) annotation(Line(points = {{11, 72}, {30, 72}, {30, 37}}, color = {255, 0, 255}, smooth = Smooth.None));
  annotation(uses(Modelica(version = "3.2")), Diagram(coordinateSystem(preserveAspectRatio = false, extent = {{-100, -100}, {100, 100}}), graphics));
end TestStiffness;
